import HomeImage from '../images/home.jpg'

const Home = () => {
  return (
    <div className="home-page">
      <div className="image-container"><img src={HomeImage} alt="Me in Maine"/></div>
      <div className="text-container">
        <h1>VIVIAN LI</h1>
        <div>
          Ph.D. student at University of Colorado Boulder
          Department of Computer Science
          Co-advised in the Department of Ecology & Evolutionary Biology
        </div>
      </div>
    </div>
  )
};

export default Home;
